import React, { Component } from 'react'

const regStyle = {
  position: 'relative',
  top: '42px',
  right: '65px'
}

class Register extends Component {
  render () {
    return(
      <div className ="login-container">
      <button style = {this.regStyle}>Register</button>
      </div>
    )
  }
}

export default Register
